import React from 'react'
import {motion} from "framer-motion"

export default function Box1(){
    return(
        <div className="box-container">
            <motion.div  
            className='box'
            style={{opacity:0.2}}
            animate={{
                x:900,
                opacity: 1,
            }}>

            </motion.div>

        </div>
    )
}
